E_D("replace into `phome_ecms_game` values('2111','21','0','','','','1','admin','|63|','1','0','1343228508','0','0','0','0','','','2111','0','0','0','0','0','0','三生有幸','1343228508','/spic/20120725/4302.jpg','0','1','1343228508','0','3','1','0','','0','','/d/file/swf/056.swf','667','479','三世都有幸运。形容极为难得的好机遇。结识新朋友时说的客气话。三生有幸，是中国老话儿。三生乃佛家术语，盖指前生、今生、来生，幸是幸运。','1','','0','','1','/dpic/20120725/4303.jpg','10158','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE9WRmwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/056.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/056.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/056.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('2112','21','0','','','','1','admin','|63|','1','0','1343228508','0','0','0','0','','','2112','0','0','0','0','0','0','一窍不通','1343228508','/spic/20120725/4264.jpg','0','1','1343228508','0','3','1','0','','0','','/d/file/swf/065.swf','667','479','一窍不通，比喻什么都不懂，闭塞，愚钝。出自战国·吕不韦《吕氏春秋·过理》：“杀比干而视其心，不适也。孔子闻之曰：''其窍通，则比干不死矣。''高诱注：“纣性不仁，心不通，安于为恶，杀比干，故孔子言其一窍通则比干不见杀也。”','1','','0','','1','/dpic/20120725/4265.jpg','10167','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE9hbFYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/065.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/065.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/065.jpg','0','三个月以上','0','','0','','0','0','0');");
