E_D("replace into `phome_ecms_game` values('2114','21','0','','','','1','admin','|63|','1','0','1343228508','0','0','0','0','','','2114','0','0','0','0','0','0','狡兔三窟','1343228508','/spic/20120725/4306.jpg','0','1','1343228508','0','3','1','0','','0','','/d/file/swf/055.swf','667','479','语出《战国策》的名篇《冯谖客孟尝君》冯暖说：“狡兔三窟，仅得免其死耳。今有一窟，未得高枕而卧也。”意思是狡兔三窟才免去死亡危险，你只有一处安身之所，不能高枕无忧啊！此即成语“狡兔三窟”和“高枕无忧”的来历。','1','','0','','1','/dpic/20120725/4307.jpg','10157','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE9WRlYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/055.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/055.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/055.jpg','0','三个月以上','0','','0','','0','0','0');");
