E_D("replace into `phome_ecms_game` values('2290','21','0','','','','1','admin','|63|','1','0','1343228600','0','0','0','0','','','2290','0','0','0','0','0','0','成语故事_三顾茅庐','1343228600','/spic/20120725/4956.jpg','0','1','1343228600','0','3','1','0','','0','','/d/file/swf/065.swf','667','479','汉末，黄巾事起，天下大乱，曹操坐据朝廷，孙权拥兵东吴，汉宗室豫州牧刘备听徐庶和司马徽说诸葛亮很有学识，又有才能，就和关羽、张飞带着礼物到隆中（今河南南阳城西，一说为湖北襄阳城西南）卧龙岗去请诸葛亮出山辅佐他。恰巧诸葛亮这天出去了，刘备只得失望地回去。不久，刘备又和关羽、张飞冒着大风雪第二次去请。不料诸葛亮又出外闲游去了。张飞本不愿意再来，见诸葛亮不在家，就催着要回去。刘备只好留下一封信，表达自己对诸葛亮的敬佩和请他出来帮助自己挽救国家危险局面的意思。 过了一段时间，刘备吃了三天素之后，准备再去请诸葛亮。关羽说诸葛亮也许是徒有虚名，未必有真才实学，不用去了。张飞却主张由他一个人去叫，如他不来，就用绳子把他捆来。刘备把张飞责备了一顿，又和他俩第三次请诸葛亮。当他们到诸葛亮家前，已经是中午，诸葛亮正在睡觉。刘备不敢惊动他，一直站到诸葛亮醒来，才彼此坐下谈话。<br /><br />三顾茅庐：比喻真心诚意，一再邀请、拜访有专长的贤人。','1','','0','','1','/dpic/20120725/4957.jpg','8004','VEhwTmRVMURPSGRPZVRoM1RtcFZkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/065.swf','http://www.61baobao.com/3.0/07/dpic/065.jpg','http://www.61baobao.com/3.0/07/pic/065.jpg','0','三个月以上','0','','0','','0','0','0');");
